import styled from '@emotion/styled';

export default styled.div`
    .public-layout-topbar {
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        z-index: 2;
    }

    .wrapper-content {
        position: relative;
        z-index: 1;
    }
`;
